import 'antd/dist/antd';
import './App.css';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <div className='navigation'>
      <Navbar />
      <div>
        <Home />
      </div>
    </div>
  );
}

function Home() {
  return (
    <div>
      Test Inhalt
    </div>
  )
}

export default App;
